import React, { Component } from 'react'
import AssignmentForm from "../Components/AssignmentForm"
import Assignments  from "../Components/Assignments"

export default class MiddleContainer extends Component {


    render() {
        console.log("Middle Container: ", this.props.klass)
        return (
            <div>

                {this.props.showForm? <AssignmentForm klass = {this.props.klass} handleCreate = {this.props.handleCreate}/> : <Assignments klass ={this.props.klass} assign={this.state.assign}/>}


            </div>
        )
    }
}
